import React from "react";
import EntitySideDetail from "../components/entitySideDetail";

export default class EntityView extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      error: null,
      isLoaded: false,
      entities: [],
    };
  }

  componentDidMount() {
    fetch(`http://localhost/VSV/SAT/API/getEntity.php?id=${'this.props.match.params.id'}`)
      .then((res) => res.json())
      .then(
        (result) => {
          this.setState({
            isLoaded: true,
            ...result,
          });
        },
        // Note: it's important to handle errors here
        // instead of a catch() block so that we don't swallow
        // exceptions from actual bugs in components.
        (error) => {
          this.setState({
            isLoaded: true,
            error: "Error loading entity",
          });
        }
      );
  }

  render() {
    return (
      <div>
        {/*Header Bar */}
        <div className="areas-header">
          <span className="header networkingDeviceList">
            <span>
              <span>Title </span>
              <span className="header-badge">Sub</span>
            </span>
          </span>
        </div>
        {/*Main Content*/}
        <div className="table-wrapper">
          {/*Side Detail */}
          <EntitySideDetail entityId={'this.props.match.params.id'} />
          {/*Main Detail */}
        </div>
      </div>
    );
  }
}
